import './Summary.css'

const Summary=()=>{


    return(
        <div className="summary-container">
        <div className="summary">
            <h2>Delicious Food, Deliverd To You</h2>
            <p>Choose your favorite meal from our broad slection of available meals and  enjoy a delicious lunch or dinner at home.</p>
            <br></br>
            <p>All our meals are cooked with high quality ingredients, just in time and ofcourse by experienced chefs.</p>
        </div>
        </div>

    );
}

export default Summary;
